export default function DisplayData({userData}) {
  return (
    <div className='text-center d-flex justify-content-center  '>
        {userData &&userData.map((item)=>{
          return (<div className='col-12 ' style={{border:'2px solid red',flexWrap:'wrap'}}>
            <p>{item.username}</p>
            <p>{item.password}</p>
          </div>
          )
        })}
    </div>
  )
}
